import { useStyles } from '../Styles';
import NavigableContainer from "../containers/NavigableContainer";
import React from 'react';
import hunter from "../img/hunter.jpg"
import NavBar from "./navBar";


const HomePageView = () => {
  const courses = useStyles();
  return (

      <div>
      <NavBar courses={courses} ActionButtonComponent={ActionButtonComponent}/>
      <NavigableContainer courses={courses}>
      </NavigableContainer>
        <div className={courses.greeting}>;
          <h1 style = {{color: "white"}}>Final Project</h1>
        </div>
        <img src = {hunter} alt = "Hunter College"/>
      </div>

  );
}


export default HomePageView;
